import React, { useState } from "react";
import axios from "axios";
import { Navbar } from "../index";
import "./Claim.css";

const Claim = () => {
  const [formData, setFormData] = useState({
    step: 1,
    claim_ID: "1",
    claim_username: "",
    claim_userSSID: "",
    claim_usertel: "",
    claim_email: "",
    claim_type: "0",
    claim_parcelID: "",
    claim_des: "",
    claim_bankaccount: "0",
    bankAccount: "0",
    claim_banknum: "",
    claim_bankholdername: "",
    claim_bookbank: "",
  });

  const handleChange = (e) => {
    console.log("Event target:", e.target);
    const { name, value } = e.target;
    console.log("Name:", name, "Value:", value);
    setFormData({ ...formData, [name]: value });
  };

  const handleSelectChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleBankChange = (input, e) => {
    if (input === "claim_bankaccount") {
      const value = e.target.value;
      if (value === "6") {
        setFormData({ ...formData, [input]: value, bankAccount: "" });
      } else {
        setFormData({ ...formData, [input]: value });
      }
    } else {
      setFormData({ ...formData, [input]: e.target.value });
    }
  };

  const nextStep = () => {
    setFormData((prevData) => ({
      ...prevData,
      step: prevData.step + 1,
    }));
  };

  const prevStep = () => {
    setFormData((prevData) => ({
      ...prevData,
      step: prevData.step - 1,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // Log formData here
    axios
      .post("http://localhost:3333/claim", formData)
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  const { step } = formData;

  return (
    <>
      <Navbar />
      <div className="Claim-container">
        <div className="Claim-form-container">
          <form onSubmit={handleSubmit}>
            <h1>Claim Form</h1>
            <br />
            <br />

            <div className="progress-bar">
              <div className="step-indicator">
                <div className={step >= 1 ? "circle active" : "circle"}>1</div>
                <span className="step-text">Claimant</span>
              </div>
              <div className="step-indicator">
                <div className={step >= 2 ? "circle active" : "circle"}>2</div>
                <span className="step-text">Consignment</span>
              </div>
              <div className="step-indicator">
                <div className={step >= 3 ? "circle active" : "circle"}>3</div>
                <span className="step-text">Bank Account</span>
              </div>
            </div>

            {/* Rendering steps based on the step state */}
            {step === 1 && (
              <div className="Input-Container">
                {/* Input fields for step 1 */}
              </div>
            )}
            {step === 2 && (
              <div className="Input-Container">
                {/* Input fields for step 2 */}
              </div>
            )}
            {step === 3 && (
              <div className="Input-Container">
                {/* Input fields for step 3 */}
              </div>
            )}

            {/* Previous and Next buttons */}
            <div className="navigation-buttons">
              {step > 1 && (
                <button type="button" onClick={prevStep}>
                  Previous
                </button>
              )}
              {step < 3 && (
                <button type="button" onClick={nextStep}>
                  Next
                </button>
              )}
              {step === 3 && (
                <button type="submit">
                  Finish
                </button>
              )}
            </div>
          </form>
        </div>
      </div>
    </>
  );
};

export default Claim;
